var vLedNames = [
    "Front Zone", "Mid Zone" , "Rear Zone"
];

var vLedPositions = [
    [1,0], [1,1], [1,2], 
];

var savedDpi1;

export function Initialize() {

if(DpiControl) {
        setDpi(dpi1);
    }
}

export function LedNames()
{
    return vLedNames;
}

export function LedPositions()
{
    return vLedPositions;
}

export function Shutdown()
{
        SendColorPacket(true);
}

export function Validate(endpoint)
{
    return endpoint.interface === 3;
}

function SendColorPacket(shutdown = false) {
    let zones = [0,1,2];
    for(var iIdx = 0; iIdx < 3; iIdx++){
        var packet = [];
        packet[0x00]  = 0x00;
        packet[0x01]  = 0x21;
        packet[0x02]  = 0x01;

        packet[0x03] = zones[iIdx];
        var iPxX = vLedPositions[iIdx][0];
        var iPxY = vLedPositions[iIdx][1];
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else{
            color = device.color(iPxX, iPxY);
        }

        packet[4] = color[0];
        packet[5] = color[1];
        packet[6] = color[2];

        device.write(packet, 65);
    }
    device.pause(1)
}

export function Render() {
    
    SendColorPacket();

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }

    device.pause(1)
}

function setDpi(dpi){
    savedDpi1 = dpi1;
    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0x2D;
    packet[2] = 0x01;
    packet[3] = 0;
    packet[4] = (dpi/50);
    device.write(packet, 65);



}
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }


